import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Carousel from 'react-bootstrap/Carousel';
import Dropdown from 'react-bootstrap/Dropdown';
import img1 from './images/IMG_6466.jpeg';
import img2 from './images/IMG_6576.JPG';
import img3 from './images/IMG_6415.jpg';
import img4 from './images/IMG_6457.jpg';
import img5 from './images/IMG_6462.jpg';

// import Navbar from 'react-bootstrap/Navbar';
// import Nav from 'react-bootstrap/Nav';
// import NavDropdown from 'react-bootstrap/NavDropdown';
// import Button from 'react-bootstrap/Button';
// import DropdownButton from 'react-bootstrap/DropdownButton';

function App () {

return <div className="app">


<Dropdown>
  <Dropdown.Toggle variant="light" id="dropdown-basic">
    Menu
  </Dropdown.Toggle>

  <Dropdown.Menu>
    <Dropdown.Item href="#/action-1">Home</Dropdown.Item>
    <Dropdown.Item href="#/action-2">Gallery</Dropdown.Item>
    <Dropdown.Item href="#/action-3">Materials</Dropdown.Item>
    <Dropdown.Item href="#/action-3">About me</Dropdown.Item>
    <Dropdown.Item href="#/action-3">What is macrame?</Dropdown.Item>
    <Dropdown.Item href="#/action-3">Tutorials</Dropdown.Item>
    <Dropdown.Item href="#/action-3">Blog</Dropdown.Item>
    <Dropdown.Item href="#/action-3">Contact</Dropdown.Item>
  </Dropdown.Menu>
</Dropdown>



<Carousel >
  <Carousel.Item> 
    <img
      className="d-block w-6"
      src={img1}
      alt="First slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item class="d-flex justify-content-center">
    <img
      className="d-block w-6"
      src={img2}
      alt="Second slide"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-6"
      src={img3}
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-6"
      src={img4}
      alt="Fourth slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-6"
      src={img5}
      alt="Fifth slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>

</div>

}

export default App;
